import React, { Component } from 'react'
import {Form,Input,Tree} from 'antd'
const Item =Form.Item
export default class AuthForm extends Component {

    // state={
    //     treeData:[]
    // }
    componentDidMount(){
        const treeData = [
            {
            title: 'parent 1',
            key: '0-0',
            children: [
                {
                title: 'parent 1-0',
                key: '0-0-0',
                disabled: true,
                children: [
                    {
                    title: 'leaf',
                    key: '0-0-0-0',
                    disableCheckbox: true,
                    },
                    {
                    title: 'leaf',
                    key: '0-0-0-1',
                    },
                ],
                },
                {
                title: 'parent 1-1',
                key: '0-0-1',
                children: [
                    {
                    title: (
                        <span
                        style={{
                            color: '#1890ff',
                        }}
                        >
                        sss
                        </span>
                    ),
                    key: '0-0-1-0',
                    },
                ],
                },
            ],
            },
        ];
    }

    



    render() {
        const {role} =this.props   //父组件传递过来的
        return (
            <div>
                <Item label="角色名称">
                    <Input value={role.name} disabled/>
                </Item>

                <Tree
                checkable
                defaultExpandedKeys={['0-0-0', '0-0-1']}
                defaultSelectedKeys={['0-0-0', '0-0-1']}
                defaultCheckedKeys={['0-0-0', '0-0-1']}
                onSelect={onSelect}
                onCheck={onCheck}
                treeData={treeData}
                />
            </div>
        )
    }
}
